package com.beans;

public class Bzdm {
	private String kind;
	private String bt;
	private String code;
	private String mc;
	private String fdm;
	private String sfjy;
	private Integer pxh;
	public Bzdm() {
		super();
		// TODO Auto-generated constructor stub
	}
	public Bzdm(String kind, String bt, String code, String mc, String fdm, String sfjy, Integer pxh) {
		super();
		this.kind = kind;
		this.bt = bt;
		this.code = code;
		this.mc = mc;
		this.fdm = fdm;
		this.sfjy = sfjy;
		this.pxh = pxh;
	}
	public String getKind() {
		return kind;
	}
	public void setKind(String kind) {
		this.kind = kind;
	}
	public String getBt() {
		return bt;
	}
	public void setBt(String bt) {
		this.bt = bt;
	}
	public String getCode() {
		return code;
	}
	public void setCode(String code) {
		this.code = code;
	}
	public String getMc() {
		return mc;
	}
	public void setMc(String mc) {
		this.mc = mc;
	}
	public String getFdm() {
		return fdm;
	}
	public void setFdm(String fdm) {
		this.fdm = fdm;
	}
	public String getSfjy() {
		return sfjy;
	}
	public void setSfjy(String sfjy) {
		this.sfjy = sfjy;
	}
	public Integer getPxh() {
		return pxh;
	}
	public void setPxh(Integer pxh) {
		this.pxh = pxh;
	}
	

}
